function owl_cursel_init(){
    //alert('1');
	
     $('body').find('.owl-carousel').each(function(index, element) {
            if($(this).hasClass('owl-loaded')){ // if already a slider is running, then skip
                return;
            }             
            else {
                if($(this).hasClass('relatedStories'))
                {
                    $(this).owlCarousel({
                      nav : true, // Show next and prev buttons
                      slideSpeed : 300,
                      paginationSpeed : 400,
                      singleItem:true,
                      items :4,
                      loop:true,
                      responsive: {
                            0: {items: 1},
                            480: {items: 1},
                            640: {items: 2},
                            768: {items: 3},
                            1000: {items: 4}
                        }
                    });
                }

                else if($(this).attr('id')=="owl12")
              {
                $(this).owlCarousel({
                    nav : true, // Show next and prev buttons
                    slideSpeed : 300,
                    paginationSpeed : 400,
                    singleItem:true,
                    items :3,
                    loop:true,
                    responsive: {
                          0: {items: 1},
                          768: {items: 2},
                          1000: {items:3}
                      }
                  });
              } else if($(this).attr('id')=="owl13")
              {
                $(this).owlCarousel({
                    nav : true, // Show next and prev buttons
                    slideSpeed : 300,
                    paginationSpeed : 400,
                    singleItem:true,
                    items :3,
                    loop:true,
                    responsive: {
                          0: {items: 1},
                          768: {items: 2},
                          1000: {items:3}
                      }
                  });
              } 
              else if($(this).attr('id')=="owl5")
              {
                $(this).owlCarousel({
                    nav : true, // Show next and prev buttons
                    slideSpeed : 300,
                    paginationSpeed : 400,
                    singleItem:true,
                    items :4,
                    loop:true,
                    responsive: {
                          0: {items: 1.5},
                          480: {items: 1.5},
                          640: {items: 2},
                          768: {items: 3},
                          1000: {items: 4}
                      }
                  });
              }
              else if($(this).attr('id')=="owl3")
              {
                  $(this).owlCarousel({
                    nav : true, // Show next and prev buttons
                    slideSpeed : 300,
                    paginationSpeed : 400,
                    singleItem:true,
                    items :1,
                    loop:true,
                    transitionStyle : 'fade',
                  });
              }
              else if($(this).attr('id')=="owl14")
              {
                $(this).owlCarousel({
                    nav : true, // Show next and prev buttons
                    slideSpeed : 300,
                    paginationSpeed : 400,
                    singleItem:true,
                    items :3,
                    loop:true,
                    responsive: {
                          0: {items: 1},
                          768: {items: 2},
                          1000: {items:3}
                      }
                  });
              }
                 
            }
        });
}

