function topicTags() {
var x = document.getElementsByClassName("article-tags--item");
        var result = "";
        if (x.length > 0) {
            for (var i = 0; i < x.length; i++)
            {
               // console.log(x[i].innerHTML);
                result += x[i].innerHTML.split("class=")[1].split("\"")[1] + "-" + x[i].innerHTML.split("class=")[1].split("\"")[2].split(">")[1].split("<")[0] + "|";
            }

        }
        return (result.substr(0,result.length-1));
}


function gtmNextArrowTop() {

	dataLayer.push({
	  'event' : 'eventVPV',
	  'eventCategory' : 'next-arrow-slide-show-top',
	  'eventAction' : 'click',
	  'eventLabel' : location.pathname,
	  'page' : location.pathname,
	  'vpvPageType' : 'Slideshow',
	  'vpvSection' : document.title.substring(document.title.indexOf("Section :-") + 11,document.title.indexOf(" | Subsection :-")),
	  'vpvSubsection' : document.title.substring(document.title.indexOf("Subsection :-") + 14,document.title.indexOf(" | Author :-")),
	  'vpvAuthor' : document.title.substring(document.title.indexOf("Author :-") + 10,document.title.indexOf(" | Embeds :-")),
	  'vpvEmbeds' : document.title.substring(document.title.indexOf("Embeds :-") + 10,document.title.indexOf(" | Covers :-")),
	  'vpvCover' : document.title.substring(document.title.indexOf("Covers :-") + 10,document.title.indexOf(" | Publish Date:-")),
	  'vpvPublishDate' : document.title.substring(document.title.indexOf("Publish Date:-") + 15,document.title.indexOf(" | Type:-")),
	  'vpvType' : document.title.substring(document.title.indexOf("| Type:-") + 9,document.title.length),
	  'vpvTopicTags' : topicTags()
	});
}

