/*Tab Logic*/
$(document).on('click','.viral-video-tab ul li a',function(event){
     var activeTab = $(this).attr("href"); //save the clicked links target
     $(".viral-video-tab ul li a").removeClass("active"); // remove pre-highlighted tabs
     $(this).addClass("active"); //set this link to highlight
     $(".tabContents").hide(); // again hide pre-showing div
     $(activeTab).fadeIn(); //match the target div &amp; show it
     owl_cursel_init();
	 (window.navigator.appName == "Microsoft Internet Explorer") && jQuery(window).trigger('resize') || window.dispatchEvent(new Event('resize'));
     return false;
});

$(document).on('click','.videoShowMore',function(){
  $('#'+$(this).attr('read_id')).show();
  $(this).hide();
});

// function to fix instory right sidebar
function fixRightbar(){
	if($(window).width() > 850){
		if($(window).width() > 1280){
			$('.video .right-sidebar.sidebar-fixed').css({right: parseInt(($(window).width() - $('#navBar .midWrap').outerWidth())/2)+'px'});
		}
		else{
			$('.video .right-sidebar.sidebar-fixed').css({right: parseInt((($(window).width() - $('#navBar .midWrap').outerWidth())/2) + 20)+'px'});
		}
	}
}

$(document).ready(function(e) {
	owl_cursel_init();
    fixRightbar();
});

$(window).on('load resize', function(e){
	fixRightbar();
});
